import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { NuevaCajaComponent } from './nueva-caja/nueva-caja.component';
import { ListaCajasComponent } from './lista-cajas/lista-cajas.component';
import { NuevaCategoriaComponent } from './nueva-categoria/nueva-categoria.component';
import { ListaCategoriasComponent } from './lista-categorias/lista-categorias.component';
import { NuevoProveedorComponent } from './nuevo-proveedor/nuevo-proveedor.component';
import { ListaProveedoresComponent } from './lista-proveedores/lista-proveedores.component';
import { NuevoUsuarioComponent } from './nuevo-usuario/nuevo-usuario.component';
import { NuevoClienteComponent } from './nuevo-cliente/nuevo-cliente.component';
import { ListaClientesComponent } from './lista-clientes/lista-clientes.component';
import { ListaUsuariosComponent } from './lista-usuarios/lista-usuarios.component';
import { AdministracionRoutingModule } from './administracionRouting.module';



@NgModule({
  declarations: [
    NuevaCajaComponent,
    ListaCajasComponent,
    NuevaCategoriaComponent,
    ListaCategoriasComponent,
    NuevoProveedorComponent,
    ListaProveedoresComponent,
    NuevoUsuarioComponent,
    NuevoClienteComponent,
    ListaClientesComponent,
    ListaUsuariosComponent
  ],
  imports: [
    CommonModule,
    AdministracionRoutingModule
  ]
})
export class AdministracionModule { }
